AWSS ML Certification or AWS Data Engineer Certification is desired.
Must be US Citizen
Must be able to obtain and maintain a Public Trust security clearance
About&#8239;Analytica: Analytica is a leading consulting and information technology solutions provider to public sector organizations supporting health, civilian, and national security missions. The company is an award-winning SBA certified 8(a) small business&#8239;that has&#8239;been recognized by Inc. Magazine each of the past three years as one of the 250 fastest-growing&#8239;companies in the U.S. Analytica specializes in providing software and systems engineering, information management, analytics & visualization, agile project management, and management consulting services. The company&#8239;is appraised by the Software Engineering Institute (SEI) at CMMI¬Æ Maturity Level 3 and is an ISO 9001:2008 certified provider.
